        "vaeua-gui-eua.sas.van.control.initialValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Anger kontrollens startvärde (standard). Startvärdet väljs första gången en användare öppnar rapporten eller när en användare väljer <span class\\="xis-windowItem">Återställ standardinställt rapporttillstånd</span>. </p><div class\\="xis-paragraph">Ange ett värde i textfältet eller ange något av följande\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automatisk</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">anger att ditt val sparas som startvärde när du sparar rapporten. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Första</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> anger att det första värdet i kontrollen är startvärdet.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">parameternamn</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">anger värdet för parametern som du väljer som kontrollens startvärde.</p><p class\\="xis-paraSimple">Du kan bara välja en parameter om det redan finns en parameter av lämplig datatyp.</p></dd></dl></div>                 </div><p class\\="xis-paragraph">Om startvärdet inte ingår i datafrågan (till exempel för att ett filter används) och kontrollen inte är obligatorisk, har kontrollen inget startvärde. Om kontrollen är obligatorisk väljs det första värdet som startvärde.</p></section>',
