        "vaeua-gui-eua.barLabelFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Alternativet <span class\\="xis-windowItem">Hantering av överlappning</span> anger vilken åtgärd som används för att visa stapeletiketter när det inte finns tillräckligt med plats för dem och de överlappar varandra.</p><div class\\="xis-paragraph">                      <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Automatiskt</span></td><td>innebär att etiketterna justeras automatiskt.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Inget</span></td><td>innebär att överlappning inte hanteras.</td></tr></table></div>                 </div></section>',
