        "vaeua-gui-eua.discreteTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Alternativet <span class\\="xis-windowItem">Hantering av överlappande kategorivärden</span> anger vilken metod som används för att passa in skalstrecksvärden på axeln när det finns begränsat med plats och de överlappar varandra. Med undantag för <span class\\="xis-windowItem">Rotera alltid</span> tillämpas den angivna metoden bara vid behov. Annars visas skalstrecksvärdena som vanligt. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Stega, korta av, utelämna alla</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">flyttar värdena uppåt och nedåt, klipper tecken från värdena och utelämnar sedan alla värden.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Visa alla</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">visar alla värden även om det finns värden som överlappar.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Rotera</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">gör att alla värden roteras diagonalt.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Rotera alltid</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">gör att alla värden roteras diagonalt oavsett om de överlappar eller inte.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Rotera alltid, utelämna alla</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">gör att alla värden roteras diagonalt och sedan utelämnas alla värden.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Stega</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">flyttar värdena uppåt och nedåt.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Stega, korta av</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">flyttar värdena uppåt och nedåt och klipper sedan tecken från värdena.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Korta av</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">klipper tecken från värdena.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Korta av, rotera</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">klipper tecken från värdena och roterar sedan alla värden diagonalt.</p></dd></dl></div>                 </div></section>',
