        "vaeua-gui-eua.sas.van.ReportReview.SlowReportLoad.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Det tar för lång tid att läsa in den första sidan i rapporten. Om andra prestandaproblem än långa inläsningstider identifieras i SAS Visual Analytics, bör du åtgärda de problemen först. Om inga andra prestandaproblem identifieras, bör du kontakta administrationsansvarig för att klargöra om det finns något annat som påverkar rapporten. Exempel\\: En långsam anslutning kan göra att rapporten tar lång tid att läsa in.</p><p class\\="xis-paragraph">Låg prioritet\\: tar &gt;\\= 5 sekunder</p><p class\\="xis-paragraph">Medelprioritet\\: tar &gt;\\= 10 sekunder</p><p class\\="xis-paragraph">Hög prioritet\\: tar &gt;\\= 25 sekunder</p></section>',
