        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.rapidGrowth.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Aktiverar den snabba algoritmen för k-medelvärdesklustring och ignorerar värdeintervallsordning. Välj inte det här alternativet om du vill använda den giriga sökalgoritmen och ta hänsyn till värdeintervallsordning. Måttresponsvärden utan indelning i värdeintervall använder varians som valkriterium. Vid val av det här alternativet kommer kategoriska och värdintervallsindelade måttresponsvärden att använda gain ratio-kriteriet. Annars används absolut gain.</p></section>',
