        "vaeua-gui-eua.sas.van.ShareDialog.embeddableLink.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Genererar anpassade HTML-taggar så att objektet eller rapporten kan bäddas in på en webbsida.</p><p class\\="xis-paragraph">För att aktivera anpassade taggar på din webbsida måste du även lägga till &lt;script&gt;-taggar till sidhuvudet. Mer information om hur du bäddar in SAS Visual Analytics-innehåll finns i <a href\\="https\\://developer.sas.com/sdk/va/docs/getting-started/" target\\="_blank" rel\\="noopener noreferrer">SAS Visual Analytics SDK-dokumentationen</a>.</p></section>',
