        "vaeua-gui-eua.sas.van.control.initialMaxValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Anger det inledande maxvärdet (övre gräns) för kontrollen. Startvärdet väljs första gången en användare öppnar rapporten eller när en användare väljer <span class\\="xis-windowItem">Återställ standardinställt rapporttillstånd</span>. </p><div class\\="xis-paragraph">Ange ett värde i textfältet eller ange något av följande\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automatisk</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">anger att ditt val sparas som startvärde när du sparar rapporten. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Maxvärde</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">anger att det högsta värdet i kontrollen är startvärdet.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">parameternamn</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">anger värdet för parametern som du väljer som kontrollens startvärde.</p><p class\\="xis-paraSimple">Du kan bara välja en parameter om det redan finns en parameter av lämplig datatyp.</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.Properties.bayesNet.prescreenPredictors.help.aria.txt": "Hjälp. Mer information om det här alternativet ",
        "vaeua-gui-eua.react.va.geo.search.includeTraffic.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Anger hur trafik används för att beräkna restiden för den grafiska funktionen. Välj ett av följande alternativ\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Nej</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Anger att beräkningen av restid utförs med ett viktat genomsnitt av historiska trafikdata för alla tider på dygnet alla dagar i veckan.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Aktuell trafik</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Anger att beräkningen av restid utförs utifrån aktuella trafikvillkor. Trafikdata kan uppdateras genom att använda <span data-icon-name\\="refresh" alt\\="ikonen för uppdatering av trafikdata" aria-label\\="ikonen för uppdatering av trafikdata"></span>. När en användare visar rapporten uppdateras inte trafiken automatiskt. Användaren måste uppdatera trafikdata för att få tillgång till de senaste trafikvillkoren.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Typisk trafik</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> anger att beräkningen av restid utförs med den typiska trafiken för den angivna tiden och veckodagen. Villkoren för typisk trafik baseras på senaste historiska data.</p><div class\\="xis-note"><span class\\="xis-noteGenText">Obs\\!</span> Tiden som du anger är den lokala tiden för platsen på kartan.</div></dd></dl></div>                 </div><div class\\="xis-note"><span class\\="xis-noteGenText">Obs\\!</span>Vid hämtning av restidsdata förbrukas kredit för ESRI Premium-tjänster.</div><div class\\="xis-note"><span class\\="xis-noteGenText">Obs\\!</span>Om det inte finns trafikdata tillgängliga för området som innehåller beräkningen av restid, används rådande hastighetsgränser för att beräkna restiden.</div></section>',
