        "vaeua-gui-eua.Properties.neuralnetwork.validateError.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Anger maxvärdet för valideringsfel som gäller för att slutföra modellträningen. Om valideringsfelet är mindre än det angivna målvärdet, avslutas modellträningen.</p></section>',
