        "vaeua-gui-eua.discreteTickValueFitPolicy.help.tip.txt": "Mer information om det här alternativet ",
        "vaeua-gui-eua.Distribution.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Anger fördelningsfunktionen som används för att modellera responsvariabeln.</p></section>',
        "vaeua-gui-eua.dataElementStyleRotation.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Alternativet <span class\\="xis-windowItem">Stilrotation för dataelement</span> anger hur stilar tilldelas till dataelementen i diagrammallen. Exempel\\: I ett linjediagram anger det här alternativet hur färger, linjemönster och markörer används för att särskilja linjer i diagrammet. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automatisk</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">använder stilrotationsinställningen från temat. De flesta SAS-teman använder inställningen <span class\\="xis-windowItem">Rotera alla färger först</span>. Temat ”High Contrast” använder inställningen <span class\\="xis-windowItem">Rotera alla attribut</span>.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Rotera alla färger först</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">visar en enfärgad fyllning, heldragen linje och enhetlig markörform till dess att alla färger i paletten har använts.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Rotera alla attribut</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">visar olika fyllningsmönster, linjemönster och markörformer utöver olika färger. Den här inställningen kan underlätta för användare med färgblindhet.</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.ShareDialog.useGuestAccess.help.aria.txt": "Hjälp. Mer information om det här alternativet ",
        "vaeua-gui-eua.Properties.svm.sigmoidParameterOne.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Anger parametern för skala (koefficienten) i sigmoidfunktionen.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communities.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Anger antalet sammanhållningar (lokala nodgrupperingar) som ska beräknas inom varje nodgrupp. Observera att det totala antalet sammanhållningar som beräknas kan vara mindre än det valda värdet beroende på nätverkets struktur och storlek.</p></section>',
