        "vaeua-gui-eua.Properties.bayesNet.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Kategoriska prediktorer behandlar ett saknat värde som ett separat värde. En kontinuerlig prediktor ersätter ett saknat värde med prediktorns medelvärde. För bayesianska nätverk inkluderas inte saknade värden i responsvariabeln.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.forceStrength.help.aria.txt": "Hjälp. Mer information om det här alternativet ",
        "vaeua-gui-eua.Properties.svm.defaultpenalty.help.tip.txt": "Mer information om det här alternativet ",
        "vaeua-gui-eua.groupingScale.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Alternativet <span class\\="xis-windowItem">Grupperingsskala</span> används för att fastställa skalan för diagram med grupperade staplar. Staplarna kan vara travade eller grupperade. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Faktiska värden</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">används för att bestämma storleken på staplarna utifrån värdena i data. Exempel\\: Anta att en stapel i en grupp har värdet 50 och att en stapel i en annan grupp har värdet 500. 500-stapeln är då 10 gånger högre än 50-stapeln.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Normalisera grupper till 100 %</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">används för att visa grupperna med en relativ skala. Varje stapel inom en grupp visas som en procent av gruppen. Exempel\\: Anta att en grupp har totalvärdet 100. Om en stapel inom den gruppen har värdet 50, är stapeln 50 % av höjden på hela gruppen.</p></dd></dl></div>                 </div><p class\\="xis-paragraph">Det här alternativet är inte tillgängligt om diagramobjektet innehåller överlagrade diagramelement. Det här alternativet är inte heller tillgängligt om du har angett samma dataintervall för axlarna i en indelning.</p></section>',
        "vaeua-gui-eua.connectOrder.help.aria.txt": "Hjälp. Mer information om det här alternativet ",
        "vaeua-gui-eua.properties.sankey.linkColor.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Färglägger länkar efter vägarna som de tillhör, händelserna som de startar från eller om de är avslutningslänkar.</p></section>',
